extern int glyphWidths[];

TScreenColor blendAlphaColor(TScreenColor forecolor, TScreenColor backcolor) {
	int alpha = forecolor >> 24 & 0xFF;
	return COLOR32(
		(int)((alpha * (forecolor & 0xFF) + (255 - alpha) * (backcolor & 0xFF)) / 255),
		(int)((alpha * (forecolor >> 8 & 0xFF) + (255 - alpha) * (backcolor >> 8 & 0xFF)) / 255),
		(int)((alpha * (forecolor >> 16 & 0xFF) + (255 - alpha) * (backcolor >> 16 & 0xFF)) / 255),
		255
	);
}

int drawGlyph(
	char chr,
	int dx,
	int dy,
	TScreenColor color,
	unsigned char* buffer,
	int bufferPitch,
	int bufferSize
) {
	if (chr < 32 || chr > 126) {
		return 0;
	}

	int glyphSize = glyphWidths[chr - 32];
	char* glyph = glyphPointers[chr - 32];

	for (int x = 0; x < glyphSize; x++) {
		for (int y = 0; y < 30; y++) {
			if (
				glyph[y * glyphSize + x] != 0
			) {
				int red = color & 0xFF;
				int green = color >> 8 & 0xFF;
				int blue = color >> 16 & 0xFF;
				TScreenColor glyphColor = COLOR32(
					red,
					green,
					blue,
					glyph[y * glyphSize + x]
				);
				int idx = (dy + y) * bufferPitch * 4 + (dx + x) * 4;
				if (idx >= 0 && idx < bufferSize) {
					TScreenColor color = blendAlphaColor(glyphColor, COLOR32(
						buffer[idx],
						buffer[idx+1],
						buffer[idx+2],
						buffer[idx+3]
					));
					buffer[idx] = color & 0xFF;
					buffer[idx + 1] = color >> 8 & 0xFF;
					buffer[idx + 2] = color >> 16 & 0xFF;
					buffer[idx + 3] = color >> 24 & 0xFF;
				}
			}
		}
	}

	return glyphSize;
}

int calculateWordWidth(char* word) {
	int wordWidth = 0;
	while (*word) {
		char chr = *word;
		int i = 0;
		if (chr >= 65 && chr <= 90) {
			i = (chr - 65);
		}
		else if (chr >= 97 && chr <= 122) {
			i = (chr - 97) + 26;
		}
		else if (chr >= 48 && chr <= 57) {
			i = 26 * 2 + (chr - 48);
		}
		else if (chr == 32) {
			wordWidth += 10;
			word++;
			continue;
		}
		else {
			word++;
			continue;
		}

		int glyphSize = glyphWidths[i];
		wordWidth += glyphSize;
		word++;
	}
	return wordWidth;
}